- `ValidationErrors.ErrorMessagesFor()` with non-existent member names
- Handler functions: `bindAndValidateJson`, `bindAndValidateForm`, `bindAndValidateQuery`
- HttpContextExtensions: `BindAndValidateJson`, `BindAndValidateForm`, `BindAndValidateQuery`

## Problems Found

The ModelValidation module had low branch coverage (10.42%) due to missing tests for:
1. Invalid model state handling in ModelState accessors
2. Request handler validation functions (bindAndValidate*)
3. HttpContext extension methods for validation
4. Edge cases in ValidationErrors

## Actions Taken

Added 12 new test cases to `tests/Oxpecker.Tests/ModelValidation.Tests.fs`:
- 2 tests for ModelState.Invalid scenarios
- 1 test for ValidationErrors edge cases  
- 6 tests for bindAndValidate* handlers (valid/invalid cases for JSON, Form, Query)
- 3 tests for HttpContextExtensions validation methods

All tests follow existing patterns using:
- xUnit `[<Fact>]` attributes
- FsUnit assertions (`shouldEqual`, `shouldBeEmpty`)
- Direct HttpContext creation (similar to existing Handlers tests)
- Proper service provider setup for JSON serializer and model binder

